import React from 'react'

const Table = ({ headerTitle, bodyTitle, more }) => {

  const headerResult = headerTitle.map((el) => {
    return <td key={el.id}>{el.title}</td>
  })

  const bodyResult = bodyTitle.map((el, index) => {
    return <tr key={index}>
      <td><input type="checkbox" /></td>
      {
        el.map((e) => {
          return <td key={e.id}>{e.title}</td>
        })
      }
    </tr>
  })

  return (
    <table className='table-dashboard table-dashboard-main'>
      <thead>
        <tr>
          <td><input type="checkbox" /></td>
          {headerResult}
        </tr>
      </thead>
      <tbody>
        {bodyResult}
        {
          more &&
          <td style={{ textAlign: "center" }} colSpan="8">المزيد من الطلبات</td>
        }
      </tbody>
    </table>
  )
}

export default Table;
